import Header from "./component/Home page/Header";
import Landing from "./component/Home page/Landing";
import Login from "./component/authentication/Login";
import SignUp from "./component/authentication/SignUp";
import {Route, Routes } from "react-router-dom";
import chroma from 'chroma-js'
import axios from "axios";
// Redux
import {Provider} from 'react-redux';
import store from './redux/store';


function App() {

    const elements = document.getElementsByClassName('but');
    Array.from(elements).forEach(element=>{
        // console.log("entered");
        const originalColor= getComputedStyle(element).backgroundColor;
        const hoverColor = chroma(originalColor).darken(0.4).hex();
        element.style.setProperty('--hover-color',hoverColor);
    });
    const submit =async()=>{

      let data={
          name:"cx",
          email:'asdsadadsafbzzdfsc@gc.com',
          password:'dsfsdfsda'
      };


       axios.post('http://localhost:5000/api/users',data).then(res=>console.log(res.data));

  } 
  submit();
  return (
    <>
    <Provider store={store} >

    <Header />
    <div className="container">
      <Routes>
        <Route path="/" element={<Landing />} />
        <Route path="/login" element={<Login />} />
        <Route path="/SignUp" element={<SignUp />} />
      </Routes>
    </div>


    </Provider>
    </>
  );
}

export default App;
